package com.camilo

import org.junit.jupiter.api.Assertions.assertFalse
import org.junit.jupiter.api.Assertions.assertTrue
import org.junit.jupiter.api.Test

internal class SubsequenceTest {

    @Test
    fun `it should return TRUE when abc is subsequence of ahbgdc`() {
        val s = "abc"
        val t = "ahbgdc"
        val result = Subsequence().isSubsequence(s, t)
        assertTrue(result)
    }

    @Test
    fun `it should return FALSE when acb is not subsequence of ahbgdc`() {
        val s = "acb"
        val t = "ahbgdc"
        val result = Subsequence().isSubsequence(s, t)
        assertFalse(result)
    }

    @Test
    fun `it should return TRUE when ab is subsequence of baab`() {
        val s = "ab"
        val t = "baab"
        val result = Subsequence().isSubsequence(s, t)
        assertTrue(result)
    }

    @Test
    fun `it should return TRUE when leeeeetcode is subsequence of long string`() {
        val s = "leeeeetcode"
        val t = ""
        val result = Subsequence().isSubsequence(s, t)
        assertTrue(result)
    }

}